import * as React from 'react';
import Checkbox from '@mui/material/Checkbox';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import CheckBoxOutlineBlankIcon from '@mui/icons-material/CheckBoxOutlineBlank';
import CheckBoxIcon from '@mui/icons-material/CheckBox';
import  {useRef, useState} from 'react';
import getPowerConsumption, {getAvrgPowerConsumption, getMaxPowerConsumption} from './PowerConsumption'
const icon = <CheckBoxOutlineBlankIcon fontSize="small" />;
const checkedIcon = <CheckBoxIcon fontSize="small" />;

export default function CheckboxesTags() {
    const [selected, setSelected] = React.useState('');
    const handleChange = (event) => {
        setSelected(event.target.value);
        console.log(event.target.value);
    };
    const options = [];
for (var i = 1; i <= 56; i++) {
    if(i!==50 && i!==30){
    // options.push({value: i, text: `Ger채t ${i}`});
    options.push(i);
    }
}
  return (
    <Autocomplete
      multiple
      id="checkboxes-tags-demo"
      options={options}
      disableCloseOnSelect
      getOptionLabel={(option) => option.toString()} 
      onChange={handleChange}



      renderOption={(props, option, { selected }) => (
        <li {...props}>
          <Checkbox

            icon={icon}
            checkedIcon={checkedIcon}
            style={{ marginRight: 8 }}
            checked={selected}
            value={selected}

          />
          {option}
        </li>
      )}
      style={{ width: 500, marginTop: 10, marginLeft:0, paddingLeft:150, }}
      renderInput={(params) => (
        <TextField {...params} label="Ger채te zum Vergleich w채hlen"/> //placeholder="Favorites" />
      )}
    />
  )
    {getPowerConsumption(selected, "PowerConsumptionFirstDevice")}
                                {getAvrgPowerConsumption(selected, "AvrgPowerConsumptionFirstDevice")}
                                {getMaxPowerConsumption(selected, "MaxPowerConsumptionFirstDevice")}

}
